import ExpenseItem from './components/ExpenseItem';

const App = () => {
  const expenses = [
    {
      title: 'Car Insurance',
      amount: 234.66,
    },
    {
      title: 'House rent',
      amount: 500,
    },
  ];
  return (
    <div>
      <h1>Here is second time in React</h1>
      <p>This also works!</p>
      <ExpenseItem />
    </div>
  );
};

export default App;
